import React, { useState } from "react";
import APP_PATHS from "../../APP_PATHS.js";
import { withRouter } from "react-router-dom";
import API_MOCK_DATA from "../../mock_data/API_MOCK_DATA.js";

const ApisPage = ({ history, currentUser: user }) => {
  if (!user) history.push(APP_PATHS.home);

  const [currentUser, setCurrentUser] = useState(user);

  const generateGroups = () => {
    const groups = [];

    for (const [group, apiArray] of Object.entries(API_MOCK_DATA)) {
      groups.push(
        <h1 className="api-group-header">{group}</h1>
      );
      groups.push(
        apiArray.map(apiData => (
          <React.Fragment>
            <h3 className="api-name">{apiData.name}</h3>
            <p className="api-description">{apiData.description}</p>
            {
              apiData.tags.map(tag => <p className="api-tag">{tag}</p>)
            }
          </React.Fragment>
        ))
      );
    }

    console.log(groups)

    return groups;
  };

  return (
    <div id="apis-page" className="page">
      {
        generateGroups()
      }
    </div>
  );
};

export default withRouter(ApisPage);
